import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";
// Import all the components for your application
import Home from "./components/Home";
import Login from "./components/Login";
import Register from "./components/Register";
import Dashboard from "./components/Dashboard";
import NotFound from "./components/NotFound";

function App() {
  return (
    <BrowserRouter>
      {/* This is a simple navigation bar. You should replace this with a proper
        navbar component later on.
      */}
      <nav style={{ marginBottom: "20px" }}>
        <ul style={{ listStyle: "none", display: "flex", gap: "1rem" }}>
          <li><a href="/">Home</a></li>
          <li><a href="/login">Login</a></li>
          <li><a href="/register">Register</a></li>
          <li><a href="/dashboard">Dashboard</a></li>
        </ul>
      </nav>

      <Routes>
        {/* The home page */}
        <Route path="/" element={<Home />} />

        {/* The authentication routes */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* The dashboard, which would be protected later */}
        <Route path="/dashboard" element={<Dashboard />} />

        {/* A catch-all route for any undefined paths */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
